import { makeStyles, Theme, createStyles, Typography } from "@material-ui/core";
import { Link } from "react-router-dom";
import styled from "styled-components";
import PrimaryButton from "../commons/button/PrimaryButton";
import { PersistentDrawerMainContent } from "../commons/persistentDrawerMainContent";
import Sidemenu from "../commons/sidemenu";
import Button from "@material-ui/core/Button";
import PersistentDrawer from "../commons/persistentDrawer";

const Copyright = () => {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {"Copyright © "}
      <Link color="inherit" to="/">
        管理画面
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
};

export interface GenericTemplateProps {
  children: React.ReactNode;
  title: string;
}

const MainTemplate: React.FC<MainTemplateProps> = (props) => {
  return (
    <>
      <StyledMainTemplate>
        <PersistentDrawer
          sidemenu={<Sidemenu title="test" />}
          title={props.title}
        />
        <PersistentDrawerMainContent />

        <PrimaryButton text="まえ" url="/test" />
        <PrimaryButton text="うしろ" url="/page2" />
      </StyledMainTemplate>

      <footer style={styles.footer}>
        <Typography variant="body2" color="textSecondary" align="center">
          {"Copyright © "}
          <Link color="inherit" to="/">
            home
          </Link>{" "}
          {new Date().getFullYear()}
          {"."}
        </Typography>
      </footer>
    </>
  );
};
export type MainTemplateProps = {
  title: string;
};

const StyledMainTemplate = styled.div`
  background: #fffacd;
  height: 1000px;
  width: 700px;
  margin-left: auto;
  margin-right: auto;
`;
const styles = styled.div`
  footer: {
  }
`;
export default MainTemplate;
